-- ----------------------------
-- Procedure structure for doCloud
-- ----------------------------
DROP PROCEDURE IF EXISTS `doCloud`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doCloud`( location varchar(10))
BEGIN 

    -- 
    -- 
    DECLARE write_time datetime;
    -- ()
    DECLARE lower_cloud_bottom_avg varchar(10);
    -- 
    DECLARE vertical_vis int;
    -- ()-1
    DECLARE cloud_bottom_avg_b1 varchar(10);
    -- ()-2
    DECLARE cloud_bottom_avg_b2 varchar(10);
    -- ()-3
    DECLARE cloud_bottom_avg_b3 varchar(10);
    -- ()-1
    DECLARE cloud_bottom_min_b1 varchar(10);
    -- ()-2
    DECLARE cloud_bottom_min_b2 varchar(10);
    -- ()-3
    DECLARE cloud_bottom_min_b3 varchar(10);
    -- -1
    DECLARE cloud_bottom_range_b1 varchar(10);
    -- -2
    DECLARE cloud_bottom_range_b2 varchar(10);
    -- -3
    DECLARE cloud_bottom_range_b3 varchar(10);
    -- -1
    DECLARE sample_b1 varchar(5);
    -- -2
    DECLARE sample_b2 varchar(5);
    -- -3
    DECLARE sample_b3 varchar(5);
    -- ()-1
    DECLARE cover_situation_estimate_b1 varchar(20);
    -- ()-2
    DECLARE cover_situation_estimate_b2 varchar(20);
    -- ()-3
    DECLARE cover_situation_estimate_b3 varchar(20);
    -- --1
    DECLARE inst_height_b1 varchar(10);
    -- --2
    DECLARE inst_height_b2 varchar(10);
    -- --3
    DECLARE inst_height_b3 varchar(10);
    -- --1
    DECLARE inst_cloud_thick_b1 varchar(10);
    -- --2
    DECLARE inst_cloud_thick_b2 varchar(10);
    -- --3
    DECLARE inst_cloud_thick_b3 varchar(10);

    -- 
    -- 
    DECLARE numOk int;
    -- ID
    DECLARE nowId int;
    --  
    DECLARE startTime datetime;
    --  
    DECLARE endTime datetime;

    -- 
    set write_time = UTC_TIMESTAMP();

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+cloud start...'));

    -- ID
    select max(id) into nowId from draw_ceilometer ;
    --  
    set endTime = write_time;
    --  
    set startTime = date_add(endTime, interval -10 minute);

    -- ()
    set numOk = (select count(*) from draw_ceilometer where utc between startTime and endTime and trim(first) <> 'NODET')
                        + (select count(*) from draw_ceilometer where utc between startTime and endTime and trim(second) <> 'NODET')
                        + (select count(*) from draw_ceilometer where utc between startTime and endTime and trim(third) <> 'NODET');
    if numOk > 0 then
        set lower_cloud_bottom_avg = round(((select sum(first) from draw_ceilometer where utc between startTime and endTime and trim(first) <> 'NODET')
                                                         + (select sum(second) from draw_ceilometer where utc between startTime and endTime and trim(second) <> 'NODET')
                                                         + (select sum(third) from draw_ceilometer where utc between startTime and endTime and trim(third) <> 'NODET'))/numOk);
    else
        set lower_cloud_bottom_avg = 'NCD';
    end if;

    -- 
    select round(avg(verticalvisibility)) into vertical_vis 
    from draw_ceilometer where utc between startTime and endTime and trim(verticalvisibility) <> 'NODET'; 

    -- ()-1, ()-1, -1
    select round(avg(first)), round(min(CONVERT(first,DECIMAL))), round(max(CONVERT(first,DECIMAL)) - min(CONVERT(first,DECIMAL))) into cloud_bottom_avg_b1, cloud_bottom_min_b1, cloud_bottom_range_b1 
    from draw_ceilometer where utc between startTime and endTime and trim(first) <> 'NODET';
    if cloud_bottom_avg_b1 is null then
        set cloud_bottom_avg_b1 = 'NCD';
        set cloud_bottom_min_b1 = 'NCD';
        set cloud_bottom_range_b1 = 'NCD';
    end if;

    -- ()-2, ()-2, -2
    select round(avg(second)), round(min(CONVERT(second,DECIMAL))), round(max(CONVERT(second,DECIMAL)) - min(CONVERT(second,DECIMAL))) into cloud_bottom_avg_b2, cloud_bottom_min_b2, cloud_bottom_range_b2 
    from draw_ceilometer where utc between startTime and endTime and trim(second) <> 'NODET';
    if cloud_bottom_avg_b2 is null then
        set cloud_bottom_avg_b2 = 'NCD';
        set cloud_bottom_min_b2 = 'NCD';
        set cloud_bottom_range_b2 = 'NCD';
    end if;

    -- ()-3, ()-3, -3
    select round(avg(third)), round(min(CONVERT(third,DECIMAL))), round(max(CONVERT(third,DECIMAL)) - min(CONVERT(third,DECIMAL))) into cloud_bottom_avg_b3, cloud_bottom_min_b3, cloud_bottom_range_b3 
    from draw_ceilometer where utc between startTime and endTime and trim(third) <> 'NODET';
    if cloud_bottom_avg_b3 is null then
        set cloud_bottom_avg_b3 = 'NCD';
        set cloud_bottom_min_b3 = 'NCD';
        set cloud_bottom_range_b3 = 'NCD';
    end if;

    -- --1, --2, --3, --1, --2, --3
    select first, second, third, firstdepth, seconddepth, thirddepth 
       into inst_height_b1, inst_height_b2, inst_height_b3, inst_cloud_thick_b1, inst_cloud_thick_b2, inst_cloud_thick_b3
      from draw_ceilometer
    where id = nowId;
    -- 
    if trim(inst_height_b1) = 'NODET' then
        set inst_height_b1 = 'NCD';
    end if;
    if trim(inst_height_b2) = 'NODET' then
        set inst_height_b2 = 'NCD';
    end if;
    if trim(inst_height_b3) = 'NODET' then
        set inst_height_b3 = 'NCD';
    end if;
    if trim(inst_cloud_thick_b1) = 'NODT' then
        set inst_cloud_thick_b1 = 'NCD';
    end if;
    if trim(inst_cloud_thick_b2) = 'NODT' then
        set inst_cloud_thick_b2 = 'NCD';
    end if;
    if trim(inst_cloud_thick_b3) = 'NODT' then
        set inst_cloud_thick_b3 = 'NCD';
    end if;

        location,
        write_time,
        lower_cloud_bottom_avg,
        vertical_vis,
        cloud_bottom_avg_b1,
        cloud_bottom_avg_b2,
        cloud_bottom_avg_b3,
        cloud_bottom_min_b1,
        cloud_bottom_min_b2,
        cloud_bottom_min_b3,
        cloud_bottom_range_b1,
        cloud_bottom_range_b2,
        cloud_bottom_range_b3,
        sample_b1,
        sample_b2,
        sample_b3,
        cover_situation_estimate_b1,
        cover_situation_estimate_b2,
        cover_situation_estimate_b3,
        inst_height_b1,
        inst_height_b2,
        inst_height_b3,
        inst_cloud_thick_b1,
        inst_cloud_thick_b2,
        inst_cloud_thick_b3)
    VALUES(
        location,
        write_time,
        lower_cloud_bottom_avg,
        vertical_vis,
        cloud_bottom_avg_b1,
        cloud_bottom_avg_b2,
        cloud_bottom_avg_b3,
        cloud_bottom_min_b1,
        cloud_bottom_min_b2,
        cloud_bottom_min_b3,
        cloud_bottom_range_b1,
        cloud_bottom_range_b2,
        cloud_bottom_range_b3,
        sample_b1,
        sample_b2,
        sample_b3,
        cover_situation_estimate_b1,
        cover_situation_estimate_b2,
        cover_situation_estimate_b3,
        inst_height_b1,
        inst_height_b2,
        inst_height_b3,
        inst_cloud_thick_b1,
        inst_cloud_thick_b2,
        inst_cloud_thick_b3);

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+cloud end...'));
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for doInfo
-- ----------------------------
DROP PROCEDURE IF EXISTS `doInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doInfo`(selLocation varchar(10), infoKbn varchar(1))
BEGIN 

    -- 
    -- 
    DECLARE write_time datetime;
    -- 
    DECLARE info_val varchar(255);
    -- 10min
    DECLARE sel_dirct_10_min int;
    -- 10min
    DECLARE sel_dirct_10_max int;
    -- 10min
    DECLARE sel_dirct_10_max_ch int;
    -- 10min
    DECLARE sel_dirct_10_avrg int;
    -- 10min
    DECLARE sel_speed_10_avrg int;
    -- 10min-
    DECLARE sel_speed_10_blastwind int;
    -- CAVOK1
    DECLARE cavok_1 varchar(1);
    -- CAVOK2
    DECLARE cavok_2 varchar(1);
    -- CAVOK3
    DECLARE cavok_3 varchar(1);
    -- 
    DECLARE sel_vertical_vis int;
    -- 
    DECLARE numRecord int;
    -- 
    DECLARE sel_manual_visib int;
    -- RVR10
    DECLARE sel_rvr_10_avg varchar(10);
    -- 
    DECLARE sel_rvr_tend varchar(10);
    -- 
    DECLARE sel_rvr_var varchar(10);
    -- CD
    DECLARE sel_rwy_cd varchar(20);
    -- 
    DECLARE temp_val varchar(20);
    --  
    DECLARE startTime datetime;
    --  
    DECLARE endTime datetime;
    -- (QNH)
    DECLARE sel_sea_surface_qhn_1 int;
    -- 
    DECLARE sel_temp double(6,1);
    -- 
    DECLARE sel_dew_point double(6,1);
    -- 
    DECLARE sel_bcc varchar(10);
    -- 
    DECLARE sel_tcc varchar(10);
    -- 
    DECLARE sel_info_typeVal varchar(255);
    -- 
    DECLARE sel_info_locate varchar(255);
    -- 
    DECLARE sel_info_timeVal varchar(255);
    -- 
    DECLARE sel_info_wind varchar(255);
    -- 
    DECLARE sel_info_vis varchar(255);
    -- 
    DECLARE sel_info_rvr varchar(255);
    -- 1
    DECLARE sel_info_wth1 varchar(255);
    -- 2
    DECLARE sel_info_wth2 varchar(255);
    -- 3
    DECLARE sel_info_wth3 varchar(255);
    -- 
    DECLARE sel_info_cloud varchar(255);
    -- 
    DECLARE sel_info_temp_dp varchar(255);
    -- 
    DECLARE sel_info_qnh varchar(255);
    -- 1
    DECLARE sel_info_wth_end1 varchar(255);
    -- 2
    DECLARE sel_info_wth_end2 varchar(255);
    -- 3
    DECLARE sel_info_wth_end3 varchar(255);
    -- 
    DECLARE sel_info_ws varchar(255);
    -- 
    DECLARE sel_info_trend varchar(255);

    -- 
    set write_time = UTC_TIMESTAMP();

    -- 
    call doLog(CONCAT('infoKbn:', infoKbn, '+write_time:' ,write_time, '+doInfo start...'));

    -- 
    set sel_info_typeVal = '';
    set sel_info_locate = '';
    set sel_info_timeVal = '';
    set sel_info_wind = '';
    set sel_info_vis = '';
    set sel_info_rvr = '';
    set sel_info_wth1 = '';
    set sel_info_wth2 = '';
    set sel_info_wth3 = '';
    set sel_info_cloud = '';
    set sel_info_temp_dp = '';
    set sel_info_qnh = '';
    set sel_info_wth_end1 = '';
    set sel_info_wth_end2 = '';
    set sel_info_wth_end3 = '';
    set sel_info_ws = '';
    set sel_info_trend = '';

    -- CAVOK1
    set cavok_1 = '0';
    -- CAVOK2
    set cavok_2 = '0';
    -- CAVOK3
    set cavok_3 = '0';

    -- 
    if infoKbn = '1' then
        -- METAR
        set sel_info_typeVal = 'METAR ';

    else
        -- SPECI
        set sel_info_typeVal = 'SPECI ';
    end if;
    -- 
    set info_val = sel_info_typeVal;

    -- 
    set sel_info_locate = 'ZUKD ';
    -- ()
    set info_val = CONCAT(info_val , sel_info_locate);

    -- 
    set sel_info_timeVal = CONCAT(DATE_FORMAT(UTC_TIMESTAMP(),'%d%H%i'), 'Z ');
    -- ( Z)
    set info_val = CONCAT(info_val , sel_info_timeVal);

    -- (AUTO)
    set info_val = CONCAT(info_val , 'AUTO ');

    -- 
    -- 10min, 10min, 10min, 10min,10min-
    select dirct_10_min, dirct_10_max, dirct_10_avrg, round(speed_10_avrg), round(speed_10_blastwind)
      into sel_dirct_10_min, sel_dirct_10_max, sel_dirct_10_avrg, sel_speed_10_avrg, sel_speed_10_blastwind
     from t_wind_TDZ t
    where location = selLocation order by  t.write_time desc limit 1;
    -- 

    -- 360
    if (sel_dirct_10_max - sel_dirct_10_min) < 0 then
        set sel_dirct_10_max_ch = sel_dirct_10_max + 360;
    end if;

    -- 
    if sel_speed_10_avrg = 0 then
        set sel_info_wind = CONCAT(sel_info_wind , '00000');
    else
        -- VRB
        --  60 180 2 /
        if (sel_dirct_10_max_ch - sel_dirct_10_min) >= 60 and (sel_dirct_10_max_ch - sel_dirct_10_min) < 180 and sel_speed_10_avrg < 2 then
            set sel_info_wind = CONCAT(sel_info_wind , 'VRB');
        --  180 
        elseif  (sel_dirct_10_max_ch - sel_dirct_10_min) >= 180 then
            set sel_info_wind = CONCAT(sel_info_wind , 'VRB');
        else
            set sel_info_wind = CONCAT(sel_info_wind , LPAD(sel_dirct_10_avrg, 3, '0'));
        end if;
        -- 
        if sel_speed_10_avrg >= 50 then
            set sel_info_wind = CONCAT(sel_info_wind , 'P49');
        else
            set sel_info_wind = CONCAT(sel_info_wind , LPAD(sel_speed_10_avrg, 2, '0'));
        end if;
    end if;

    -- 
    if sel_speed_10_blastwind is not null then
        -- 
        if sel_speed_10_blastwind >= 50 then
            set sel_info_wind = CONCAT(sel_info_wind , 'GP49');
        else
            set sel_info_wind = CONCAT(sel_info_wind , 'G', LPAD(sel_speed_10_blastwind, 2, '0'));
        end if;
    end if;

    -- 
    set sel_info_wind = CONCAT(sel_info_wind , 'MPS ');

    -- 
    -- 60 180 2 m/s
    if (sel_dirct_10_max_ch - sel_dirct_10_min) >= 60 and (sel_dirct_10_max_ch - sel_dirct_10_min) < 180 and sel_speed_10_avrg >= 2 then
        set sel_info_wind = CONCAT(sel_info_wind , LPAD(sel_dirct_10_min, 3, '0'), 'V', LPAD(sel_dirct_10_max, 3, '0'), ' ');
    end if;

    -- 
    set info_val = CONCAT(info_val , sel_info_wind);

    -- CAVOK1(10 000 m)
    -- 
    select vertical_vis into sel_vertical_vis from t_cloud_TDZ t
    where location = selLocation order by  t.write_time desc limit 1;
    if sel_vertical_vis >= 10000 then
        set cavok_1 = '1'; 
    end if;

    -- /
    -- 
    select bcc, tcc
      into sel_bcc, sel_tcc
     from draw_ceilometer 
    where id = (select max(id) from draw_ceilometer);

    -- CAVOK2()
    -- 15002900 
    -- 2500
    if sel_bcc < least(1500, 2500, 2900) then
        set cavok_2 = '1'; 
    end if;

    --  
    set endTime =write_time;
    --  
    set startTime = date_add(endTime, interval -10 minute);

    -- CAVOK3((level=3,4,5))
    select count(*) into numRecord from draw_visibility a , t_weather_level b 
    where a.utc between startTime and endTime and b.weather_cd = a.Precipitation ;
    if numRecord > 0 then
        set cavok_3 = '1'; 
    end if;

    -- CAVOK
    if cavok_1 = '1' and cavok_2 = '1' and cavok_3 = '1' then
        set sel_info_vis = CONCAT(sel_info_vis , 'CAVOK ');
    else
        -- 
        -- 800 m50 m
        if sel_vertical_vis < 800 then
            set sel_info_vis = CONCAT(sel_info_vis , LPAD(FLOOR(sel_vertical_vis/50)*50, 4, '0'), ' ');
        -- 800 m5 000 m100 m
        elseif sel_vertical_vis >= 800 and sel_vertical_vis < 5000 then
            set sel_info_vis = CONCAT(sel_info_vis , LPAD(FLOOR(sel_vertical_vis/100)*100, 4, '0'), ' ');
        -- 5 000 m10 000 m1000 m
        elseif sel_vertical_vis >= 5000 and sel_vertical_vis < 10000 then
            set sel_info_vis = CONCAT(sel_info_vis , LPAD(FLOOR(sel_vertical_vis/1000)*1000, 4, '0'), ' ');
        -- 10 000 m9999
        else
            set sel_info_vis = CONCAT(sel_info_vis , '9999 ');
        end if; 

        -- 
        -- 
        select manual_visib into sel_manual_visib from t_manual_history where no = (select max(no) from t_manual_history);

        -- ,,
        select rvr_10_avg, rvr_tend, rvr_var into sel_rvr_10_avg , sel_rvr_tend, sel_rvr_var
        from t_runway_visual_TDZ t
        where location = selLocation  and kbn = '1' 
        order by  t.write_time desc limit 1;

        -- 1 500 m
        if substr(sel_rvr_10_avg, 1,1) = 'M' or substr(sel_rvr_10_avg, 1,1) = 'P' then
            set temp_val = substr(sel_rvr_10_avg, 2); 
        else
            set temp_val = sel_rvr_10_avg; 
        end if;

        if (sel_manual_visib is not null and sel_manual_visib < 1500) or (temp_val is not null and temp_val < 1500) then
            set sel_info_rvr = CONCAT(sel_info_rvr , 'R');

            -- 
            select SUBSTR(lpad(rwy_cd,2, '0'), -2) into sel_rwy_cd from t_runway where is_use = '1' limit 1;
            set sel_info_rvr = CONCAT(sel_info_rvr , sel_rwy_cd, '/');

            -- 
            if (sel_rvr_var is not null and length(sel_rvr_var) <> 0) then
                set sel_info_rvr = CONCAT(sel_info_rvr , sel_rvr_var);
            else
                set sel_info_rvr = CONCAT(sel_info_rvr , temp_val);
            end if;

            -- 
            if (sel_rvr_tend = '+') then
                set sel_info_rvr = CONCAT(sel_info_rvr , 'U ');
            elseif (sel_rvr_tend = '-') then
                set sel_info_rvr = CONCAT(sel_info_rvr , 'D ');
            else
                set sel_info_rvr = CONCAT(sel_info_rvr , 'N ');
            end if;
        end if;

        --  
        select info_time into startTime from t_info where info_no = (select max(info_no) from t_info where info_type = '1');
        if startTime is null then
            set startTime = date_format('2000-01-01', '%Y-%m-%d');
        end if;

        -- ((level=3,4,5))
        select group_concat(DISTINCT sub.weather_cd SEPARATOR ' ') into temp_val
         FROM( SELECT b.weather_cd FROM t_weather a, t_weather_level b, t_master c 
                    WHERE a.location = selLocation AND a.write_time > startTime AND a.time_end IS NULL 
                        AND c.kbn_id = 'M03' AND c.prj_id = a.weather_cd AND c.extend_2 = b.weather_cd
                        AND (b. LEVEL = '3' OR b. LEVEL = '4' OR b. LEVEL = '5')
                    ORDER BY b.priority ASC LIMIT 3) sub;
        if temp_val is not null then
            set temp_val = CONCAT(temp_val, ' ');
            -- 1
            set sel_info_wth1 = substr(temp_val, 1, 3);
            -- 2
            set sel_info_wth2 = substr(temp_val, 4, 3);
            -- 3
            set sel_info_wth3 = substr(temp_val, 7, 3);
        end if;
    end if; 

    -- 
    set info_val = CONCAT(info_val , sel_info_vis);
    -- 
    set info_val = CONCAT(info_val , sel_info_rvr);
    -- 1
    set info_val = CONCAT(info_val , sel_info_wth1);
    -- 2
    set info_val = CONCAT(info_val , sel_info_wth2);
    -- 3
    set info_val = CONCAT(info_val , sel_info_wth3);

    -- //(QNH)
    select round(sea_surface_qhn_1), temp, dew_point
      into sel_sea_surface_qhn_1, sel_temp, sel_dew_point
     from t_temp_wet_TDZ t
    where location = selLocation order by  t.write_time desc limit 1;
    -- 
    if sel_temp is not null then
        if sel_temp < 0 then
            set sel_info_temp_dp = 'M';
        end if;
        if round(abs(sel_temp)) < 10 then
            set sel_info_temp_dp = CONCAT(sel_info_temp_dp , '0' , round(abs(sel_temp)), '/');
        else
            set sel_info_temp_dp = CONCAT(sel_info_temp_dp , round(abs(sel_temp)), '/');
        end if;
    end if;
    -- 
    if sel_dew_point is not null then
        if sel_dew_point < 0 then
            set sel_info_temp_dp = CONCAT(sel_info_temp_dp , 'M');
        end if;
        if round(abs(sel_dew_point)) < 10 then
            set sel_info_temp_dp = CONCAT(sel_info_temp_dp , '0' , round(abs(sel_dew_point)), ' ');
        else
            set sel_info_temp_dp = CONCAT(sel_info_temp_dp , round(abs(sel_dew_point)), ' ');
        end if;
    end if;

    -- 
    set info_val = CONCAT(info_val , sel_info_temp_dp);

    -- (QNH)
    if sel_sea_surface_qhn_1 is not null then
        set sel_info_qnh = CONCAT(sel_info_qnh , 'Q' , lpad(sel_sea_surface_qhn_1, 4, '0'), ' ');
        set info_val = CONCAT(info_val , sel_info_qnh);
    end if;

    -- 
    -- ((level=3,4,5))
    select group_concat(DISTINCT sub.weather_cd SEPARATOR ' ') into temp_val
     FROM( SELECT CONCAT('RE', b.weather_cd) as weather_cd FROM t_weather a, t_weather_level b, t_master c 
                WHERE a.location = selLocation AND a.write_time > startTime AND a.time_end IS NOT NULL 
                    AND c.kbn_id = 'M03' AND c.prj_id = a.weather_cd AND c.extend_2 = b.weather_cd
                    AND (b. LEVEL = '3' OR b. LEVEL = '4' OR b. LEVEL = '5')
                ORDER BY b.priority ASC LIMIT 3) sub;
    if temp_val is not null then
        set temp_val = CONCAT(temp_val, ' ');
        -- 1
        set sel_info_wth_end1 = substr(temp_val, 1, 5);
        -- 2
        set sel_info_wth_end2 = substr(temp_val, 6, 5);
        -- 3
        set sel_info_wth_end3 = substr(temp_val, 11, 5);
    end if;

    -- 1
    set info_val = CONCAT(info_val , sel_info_wth_end1);
    -- 2
    set info_val = CONCAT(info_val , sel_info_wth_end2);
    -- 3
    set info_val = CONCAT(info_val , sel_info_wth_end3);

    -- 
    -- 

    -- 
    set sel_info_trend = 'NOSIG=';
    set info_val = CONCAT(info_val , sel_info_trend);

    -- 
        info_type,
        info_time,
        info,
        info_typeVal,
        info_locate,
        info_timeVal,
        info_wind,
        info_vis,
        info_rvr,
        info_wth1,
        info_wth2,
        info_wth3,
        info_cloud,
        info_temp_dp,
        info_qnh,
        info_wth_end1,
        info_wth_end2,
        info_wth_end3,
        info_ws,
        info_trend,
        is_send,
        insert_time,
        insert_user,
        update_time,
        update_user)
    VALUES(
        infoKbn,
        write_time,
        info_val,
        trim(sel_info_typeVal),
        trim(sel_info_locate),
        trim(sel_info_timeVal),
        trim(sel_info_wind),
        trim(sel_info_vis),
        trim(sel_info_rvr),
        trim(sel_info_wth1),
        trim(sel_info_wth2),
        trim(sel_info_wth3),
        trim(sel_info_cloud),
        trim(sel_info_temp_dp),
        trim(sel_info_qnh),
        trim(sel_info_wth_end1),
        trim(sel_info_wth_end2),
        trim(sel_info_wth_end3),
        trim(sel_info_ws),
        trim(sel_info_trend),
        '0',
        write_time,
        'admin',
        write_time,
        'admin'
        );

    -- 
    call doLog(CONCAT('infoKbn:', infoKbn, '+write_time:' ,write_time, '+doInfo end...'));
END
;;
DELIMITER ;

