DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doRain`(location varchar(10))
BEGIN 

    -- 
    -- 
    DECLARE write_time datetime;
    --  
    DECLARE rainfall_indicator varchar(1);
    --  
    DECLARE rainfall_strength int(10);
    --  24h
    DECLARE rainfall_24h  int(10);
    --  1h
    DECLARE rainfall_1h int(10);
    --  
    DECLARE rainfall_total_yst int(10);
    --  
    DECLARE rainfall_total_tdy int(10);
    --  1
    DECLARE continue_rainfall_1h int(10);
    --  3
    DECLARE continue_rainfall_3h int(10);
    --  6
    DECLARE continue_rainfall_6h int(10);
    --  12
    DECLARE continue_rainfall_12h int(10);
    --  24
    DECLARE continue_rainfall_24h int(10);
    --  -00
    DECLARE rainfall_total_00 int(10);
    --  -01
    DECLARE rainfall_total_01 int(10);
    --  -02
    DECLARE rainfall_total_02 int(10);
    --  -03
    DECLARE rainfall_total_03 int(10);
    --  -04
    DECLARE rainfall_total_04 int(10);
    --  -05
    DECLARE rainfall_total_05 int(10);
    --  -06
    DECLARE rainfall_total_06 int(10);
    --  -07
    DECLARE rainfall_total_07 int(10);
    --  -08
    DECLARE rainfall_total_08 int(10);
    --  -09
    DECLARE rainfall_total_09 int(10);
    --  -10
    DECLARE rainfall_total_10 int(10);
    --  -11
    DECLARE rainfall_total_11 int(10);
    --  -12
    DECLARE rainfall_total_12 int(10);
    --  -13
    DECLARE rainfall_total_13 int(10);
    --  -14
    DECLARE rainfall_total_14 int(10);
    --  -15
    DECLARE rainfall_total_15 int(10);
    --  -16
    DECLARE rainfall_total_16 int(10);
    --  -17
    DECLARE rainfall_total_17 int(10);
    --  -18
    DECLARE rainfall_total_18 int(10);
    --  -19
    DECLARE rainfall_total_19 int(10);
    --  -20
    DECLARE rainfall_total_20 int(10);
    --  -21
    DECLARE rainfall_total_21 int(10);
    --  -22
    DECLARE rainfall_total_22 int(10);
    --  -23
    DECLARE rainfall_total_23 int(10);

    -- ID
    DECLARE rainAll int(10);
    --  
    DECLARE startTime datetime;
    --  
    DECLARE endTime datetime;
    -- 
    DECLARE timeDiff int(10);

    -- 
    set write_time = UTC_TIMESTAMP();

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+rain start...'));

    --  
    set endTime = write_time;
    -- 
    select time_diff into timeDiff from t_system;

    --  1
    --  
    set startTime = date_add(endTime, interval -1 minute);

    -- 
    select sum(value) into rainAll from draw_rain where utc between startTime and endTime;
    if rainAll > 0 then
        -- 1:
        set rainfall_indicator = '1';
    else
        -- 0:
        set rainfall_indicator = '0';
    end if;

    -- 24h
    --  
    set startTime = date_add(endTime, interval -24 hour);
    select sum(value) into rainfall_24h from draw_rain where utc between startTime and endTime;

    --  1h
    --  
    set startTime = date_add(endTime, interval -1 hour);
    select sum(value) into rainfall_1h from draw_rain where utc between startTime and endTime;
    set rainfall_strength = rainfall_1h;

    --  
    --  
    set startTime = date_format(write_time, '%Y%m%d');
    set startTime = date_add(startTime, interval -1*timeDiff hour);
    --  
    set endTime = date_add(startTime, interval 1 day);
    select sum(value) into rainfall_total_tdy from draw_rain where utc between startTime and endTime;

    --  
    --  
    set endTime = startTime;
    --  
    set startTime = date_add(endTime, interval -1 day);
    select sum(value) into rainfall_total_yst from draw_rain where utc between startTime and endTime;

    --  
    set endTime = write_time;
    --  
    set startTime = date_add(endTime, interval -1 hour);
    select sum(value) into continue_rainfall_1h from draw_rain where utc between startTime and endTime;

    --  3
    --  
    set startTime = date_add(endTime, interval -3 hour);
    select sum(value) into continue_rainfall_3h from draw_rain where utc between startTime and endTime;

    --  6
    set startTime = date_add(endTime, interval -6 hour);
    select sum(value) into continue_rainfall_6h from draw_rain where utc between startTime and endTime;

    --  12
    set startTime = date_add(endTime, interval -12 hour);
    select sum(value) into continue_rainfall_12h from draw_rain where utc between startTime and endTime;

    --  24
    set startTime = date_add(endTime, interval -24 hour);
    select sum(value) into continue_rainfall_24h from draw_rain where utc between startTime and endTime;

    --  UTC 0000
    --  
    set startTime = date_format(write_time, '%Y%m%d');
    --  
    set endTime = date_add(startTime, interval 1 hour);
    --  -00
    select sum(value) into rainfall_total_00 from draw_rain where utc between startTime and endTime;

    --  -01
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_01 from draw_rain where utc between startTime and endTime;

    --  -02
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_02 from draw_rain where utc between startTime and endTime;

    --  -03
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_03 from draw_rain where utc between startTime and endTime;

    --  -04
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_04 from draw_rain where utc between startTime and endTime;

    --  -05
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_05 from draw_rain where utc between startTime and endTime;

    --  -06
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_06 from draw_rain where utc between startTime and endTime;

    --  -07
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_07 from draw_rain where utc between startTime and endTime;

    --  -08
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_08 from draw_rain where utc between startTime and endTime;

    --  -09
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_09 from draw_rain where utc between startTime and endTime;

    --  -10
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_10 from draw_rain where utc between startTime and endTime;

    --  -11
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_11 from draw_rain where utc between startTime and endTime;

    --  -12
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_12 from draw_rain where utc between startTime and endTime;

    --  -13
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_13 from draw_rain where utc between startTime and endTime;

    --  -14
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_14 from draw_rain where utc between startTime and endTime;

    --  -15
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_15 from draw_rain where utc between startTime and endTime;

    --  -16
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_16 from draw_rain where utc between startTime and endTime;

    --  -17
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_17 from draw_rain where utc between startTime and endTime;

    --  -18
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_18 from draw_rain where utc between startTime and endTime;

    --  -19
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_19 from draw_rain where utc between startTime and endTime;

    --  -20
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_20 from draw_rain where utc between startTime and endTime;

    --  -21
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_21 from draw_rain where utc between startTime and endTime;

    --  -22
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_22 from draw_rain where utc between startTime and endTime;

    --  -23
    --  
    set startTime = endTime;
    --  
    set endTime = date_add(startTime, interval 1 hour);
    select sum(value) into rainfall_total_23 from draw_rain where utc between startTime and endTime;

        location,
        write_time,
        rainfall_indicator,
        rainfall_strength,
        rainfall_24h,
        rainfall_1h,
        rainfall_total_yst,
        rainfall_total_tdy,
        continue_rainfall_1h,
        continue_rainfall_3h,
        continue_rainfall_6h,
        continue_rainfall_12h,
        continue_rainfall_24h,
        rainfall_total_00,
        rainfall_total_01,
        rainfall_total_02,
        rainfall_total_03,
        rainfall_total_04,
        rainfall_total_05,
        rainfall_total_06,
        rainfall_total_07,
        rainfall_total_08,
        rainfall_total_09,
        rainfall_total_10,
        rainfall_total_11,
        rainfall_total_12,
        rainfall_total_13,
        rainfall_total_14,
        rainfall_total_15,
        rainfall_total_16,
        rainfall_total_17,
        rainfall_total_18,
        rainfall_total_19,
        rainfall_total_20,
        rainfall_total_21,
        rainfall_total_22,
        rainfall_total_23)
    VALUES (
        location,
        write_time,
        rainfall_indicator,
        rainfall_strength,
        rainfall_24h,
        rainfall_1h,
        rainfall_total_yst,
        rainfall_total_tdy,
        continue_rainfall_1h,
        continue_rainfall_3h,
        continue_rainfall_6h,
        continue_rainfall_12h,
        continue_rainfall_24h,
        rainfall_total_00,
        rainfall_total_01,
        rainfall_total_02,
        rainfall_total_03,
        rainfall_total_04,
        rainfall_total_05,
        rainfall_total_06,
        rainfall_total_07,
        rainfall_total_08,
        rainfall_total_09,
        rainfall_total_10,
        rainfall_total_11,
        rainfall_total_12,
        rainfall_total_13,
        rainfall_total_14,
        rainfall_total_15,
        rainfall_total_16,
        rainfall_total_17,
        rainfall_total_18,
        rainfall_total_19,
        rainfall_total_20,
        rainfall_total_21,
        rainfall_total_22,
        rainfall_total_23);

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+wind end...'));
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for doRunwayVisualData
-- ----------------------------
DROP PROCEDURE IF EXISTS `doRunwayVisualData`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doRunwayVisualData`(location varchar(10))
BEGIN
    -- 
