    -- 
    DECLARE rvr int;
    -- 1
    DECLARE rvr_1_avg int;
    -- 55
    DECLARE rvr_5_avg int;
    -- 5105
    DECLARE rvr_5_avg_p int;
    -- 10
    DECLARE rvr_10_avg int;
    -- 10
    DECLARE rvr_10_min int;
    -- 10
    DECLARE rvr_10_max int;
    -- 1
    DECLARE mor_1 int;
    -- 10
    DECLARE mor_10 int;
    -- 
    DECLARE mor_inst_raw int;
    --  BL 
    DECLARE bkground_light_lv varchar(10) character set gbk;
    --  
    DECLARE extinction varchar(10);
    --  
    DECLARE light_level varchar(10);

    -- 
    -- 
    DECLARE startTime datetime;
    -- 
    DECLARE endTime datetime;
    -- 11
    DECLARE avg_p1 int;
    -- 12
    DECLARE avg_p2 int;
    -- 13
    DECLARE avg_p3 int;
    -- 14
    DECLARE avg_p4 int;
    -- 15
    DECLARE avg_p5 int;
    -- 16
    DECLARE avg_p6 int;
    -- 17
    DECLARE avg_p7 int;
    -- 18
    DECLARE avg_p8 int;
    -- 19
    DECLARE avg_p9 int;
    -- 110
    DECLARE avg_p10 int;
    
    -- 
    set write_time = UTC_TIMESTAMP();
    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+doRunwayVisualData start...'));
    delete from t_runway_visual_calculate where location = location;

    -- , 
    select value1 , value2 into rvr, extinction from draw_backgroundlight where id = (select max(id) from draw_backgroundlight);

    -- 1
    -- 
    set endTime = write_time;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into rvr_1_avg from draw_backgroundlight where utc between startTime and endTime;

    -- 55
    -- 
