    -- 5105
    -- 
    set endTime = date_add(write_time, interval -5 minute) ;
    -- 
    set startTime = date_add(endTime, interval -5 minute) ;
    select avg(value1) into rvr_5_avg_p from draw_backgroundlight where utc between startTime and endTime;

    -- 10
    -- 
    set endTime = write_time;
    -- 
    set startTime = date_add(endTime, interval -10 minute) ;
    select avg(value1) into rvr_10_avg from draw_backgroundlight where utc between startTime and endTime;

    -- 11
    -- 
    set endTime = write_time;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p1 from draw_backgroundlight where utc between startTime and endTime;

    -- 12
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p2 from draw_backgroundlight where utc between startTime and endTime;

    -- 13
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p3 from draw_backgroundlight where utc between startTime and endTime;

    -- 14
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p4 from draw_backgroundlight where utc between startTime and endTime;

    -- 15
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p5 from draw_backgroundlight where utc between startTime and endTime;

    -- 16
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p6 from draw_backgroundlight where utc between startTime and endTime;

    -- 17
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p7 from draw_backgroundlight where utc between startTime and endTime;

    -- 18
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p8 from draw_backgroundlight where utc between startTime and endTime;

    -- 19
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p9 from draw_backgroundlight where utc between startTime and endTime;

    -- 110
    -- 
    set endTime = startTime;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value1) into avg_p10 from draw_backgroundlight where utc between startTime and endTime;

    -- 10
    select least( IFNULL(avg_p1,99999),IFNULL(avg_p2,99999), IFNULL(avg_p3,99999), IFNULL(avg_p4,99999), IFNULL(avg_p5,99999), IFNULL(avg_p6,99999), IFNULL(avg_p7,99999), IFNULL(avg_p8,99999), IFNULL(avg_p9,99999), IFNULL(avg_p10,99999)) into rvr_10_min;

    -- 10
    select greatest( IFNULL(avg_p1,-1),IFNULL(avg_p2,-1), IFNULL(avg_p3,-1), IFNULL(avg_p4,-1), IFNULL(avg_p5,-1), IFNULL(avg_p6,-1), IFNULL(avg_p7,-1), IFNULL(avg_p8,-1), IFNULL(avg_p9,-1), IFNULL(avg_p10,-1)) into rvr_10_max;

    -- 1
    -- 
    set endTime = write_time;
    -- 
    set startTime = date_add(endTime, interval -1 minute) ;
    select avg(value) into mor_1 from draw_visibility where utc between startTime and endTime;

    -- 10
    -- 
    set startTime = date_add(endTime, interval -10 minute) ;
    select avg(value) into mor_10 from draw_visibility where utc between startTime and endTime;

    -- 
    select value into mor_inst_raw from draw_visibility where id = (select max(id) from draw_visibility);

    --  
    select value into light_level from draw_rlim where id = (select max(id) from draw_rlim);

    --  BL 
    select prj_name into bkground_light_lv from t_master where kbn_id = 'M10' and rvr_1_avg between extend_1 and ifnull(extend_2, 99999999);

        location,
        write_time,
        rvr,
        rvr_1_avg,
        rvr_5_avg,
        rvr_5_avg_p,
        rvr_10_avg,
        rvr_10_min,
        rvr_10_max,
        mor_1,
        mor_10,
        mor_inst_raw,
        bkground_light_lv,
        extinction,
        light_level
    )
VALUES
    (
        location,
        write_time,
        rvr,
        rvr_1_avg,
        rvr_5_avg,
        rvr_5_avg_p,
        rvr_10_avg,
        rvr_10_min,
        rvr_10_max,
        mor_1,
        mor_10,
        mor_inst_raw,
        bkground_light_lv,
        extinction,
        light_level
    );

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+doRunwayVisualData end...'));

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for doTempWetData
-- ----------------------------
DROP PROCEDURE IF EXISTS `doTempWetData`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doTempWetData`(location varchar(10))
BEGIN
    -- 
    -- 
    DECLARE write_time datetime;
     -- 1min
    DECLARE pressure_1min double;
    -- 1min
    DECLARE temp_1min double;
    -- 
    DECLARE t_max double;
    -- 
    DECLARE t_min double;
    -- 
    DECLARE temp_max_time datetime;
    -- 
    DECLARE temp_min_time datetime;
    -- 1min
    DECLARE reletive_humidity_1min varchar(10);
    -- -
    DECLARE reletive_humidity_tdmax varchar(10);
    -- -
    DECLARE reletive_humidity_tdmin varchar(10);
    -- []
    DECLARE barometer_height int(10);
    -- 
    DECLARE lat double;
    -- -3
    DECLARE press_3h double;
    -- -24
    DECLARE press_24h double;

    -- 
    -- Time
    DECLARE nowTime datetime;
    -- 
    DECLARE h_stat int;
    -- 
    DECLARE h_dev int;
    DECLARE startTime datetime;
    DECLARE endTime datetime;
    -- 
    set write_time = UTC_TIMESTAMP();
    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+doTempWetData start...'));
    delete from t_temp_wet_calculate where location = location;
    -- ----------------------------------------------------------------------------------------------------

    -- 
    set nowTime = write_time;
    -- 1
    select avg(pressure) into pressure_1min from draw_pressure where utc >= date_add(nowTime, interval -1 minute) and utc <= nowTime;
    -- 3
    select avg(pressure) into press_3h from draw_pressure where utc >= date_add(nowTime, interval -3 hour) and utc <= nowTime;
    -- 24
    select avg(pressure) into press_24h from draw_pressure where utc >= date_add(nowTime, interval -24 hour) and utc <= nowTime;
    -- ----------------------------------------------------------------------------------------------------

    -- 1
    select avg(temperature), avg(humidity)
        into temp_1min, reletive_humidity_1min
        from draw_ath where utc >= date_add(nowTime, interval -1 minute) and utc <= nowTime;
    
    -- 
    set startTime = date_format(nowTime, '%Y%m%d');
    -- 
    set endTime = date_add(startTime, interval 1 day);
    -- 
    select max(temperature), min(temperature), max(humidity), min(humidity)
        into t_max, t_min, reletive_humidity_tdmax, reletive_humidity_tdmin
        from draw_ath where utc between startTime and endTime;

    -- 
    select max(utc) into temp_max_time from draw_ath where temperature = t_max and utc between startTime and endTime;
    -- 
    select max(utc) into temp_min_time from draw_ath where temperature = t_min and utc between startTime and endTime;
    -- ----------------------------------------------------------------------------------------------------

    select station_height into h_stat from t_airport limit 1;
    select pressure_sensor_height into h_dev from t_runway where is_use = '1' limit 1;
    set barometer_height = h_stat + h_dev;
    select latitude into lat from t_airport;
    -- ----------------------------------------------------------------------------------------------------

        location,
        write_time,
        pressure_1min,
        temp_1min,
        temp_max,
        temp_min,
        temp_max_time,
        temp_min_time,
        reletive_humidity_1min,
        reletive_humidity_tdmax,
        reletive_humidity_tdmin,
        barometer_height,
        latitude,
        press_3h,
        press_24h,
        airport_height)
    VALUES(
        location,
        write_time,
        round(pressure_1min, 1),
        round(temp_1min, 1),
        round(t_max, 1),
        round(t_min, 1),
        temp_max_time,
        temp_min_time,
        round(reletive_humidity_1min, 1),
        round(reletive_humidity_tdmax, 1),
        round(reletive_humidity_tdmin, 1),
        round(barometer_height, 1),
        lat,
        round(press_3h, 1),
        round(press_24h, 1),
        h_stat
        );

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+doTempWetData end...'));

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for doWarning
-- ----------------------------
DROP PROCEDURE IF EXISTS `doWarning`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doWarning`( )
BEGIN 

    -- ()
    DECLARE varWarnR VARCHAR(1);
    -- ()
    DECLARE varWarnO VARCHAR(1);
    -- 
    DECLARE varExist varchar(1);
    -- ID
    DECLARE nowId INT;
    -- ID
    DECLARE tempId int(10);
    -- 
    DECLARE nowTime datetime;
    -- 
    DECLARE tempTime datetime;
    -- 
    DECLARE int_alternatingcurrent INT ;
    -- 
    DECLARE int_ath INT ;
    -- 
    DECLARE int_backgroundlight INT ;
    -- 
    DECLARE int_ceilometer INT ;
    -- 
    DECLARE int_mwds INT ;
    -- 
    DECLARE int_mwss INT ;
    -- 
    DECLARE int_pressure INT ;
    -- 
    DECLARE int_rain INT ;
    -- 
    DECLARE int_rlim INT ;
    -- 1
    DECLARE int_ultrasonic1 INT ;
    -- 2
    DECLARE int_ultrasonic2 INT ;
    -- 
    DECLARE int_visibility INT ;
    -- (S)
    DECLARE int_freq INT ;
    -- 
    DECLARE int_lower INT ;
    -- 
    DECLARE int_upper INT ;
    -- 1
    DECLARE temp_douVal1 double(10,3) ;
    -- 2
    DECLARE temp_douVal2 double(10,3) ;
    -- 3
    DECLARE temp_douVal3 double(10,3) ;
    -- 4
    DECLARE temp_douVal4 double(10,3) ;
    -- 5
    DECLARE temp_Val5 VARCHAR(10) ;
    -- 6
    DECLARE temp_Val6 VARCHAR(10) ;
    -- SPECI
    DECLARE temp_speci double(10,3) ;


    -- 
    set nowTime = UTC_TIMESTAMP();
    -- 
    set int_freq = 3;
    -- 
    set varWarnR = '';
    set varWarnO = '';

    -- 
    call doLog(CONCAT('nowTime:' ,nowTime, '+doWarning start...'));

    -- ,
    -- 
    SELECT
        freq_alternatingcurrent,
        freq_ath,
        freq_backgroundlight,
        freq_ceilometer,
        freq_mwds,
        freq_mwss,
        freq_pressure,
        freq_rain,
        freq_rlim,
        freq_ultrasonic1,
        freq_ultrasonic2,
        freq_visibility
    INTO
        int_alternatingcurrent,
        int_ath,
        int_backgroundlight,
        int_ceilometer,
        int_mwds,
        int_mwss,
        int_pressure,
        int_rain,
        int_rlim,
        int_ultrasonic1,
        int_ultrasonic2,
        int_visibility
    FROM
        t_draw_freq;


    -- 
    select max(id) into nowId from draw_alternatingcurrent;
    select utc into tempTime from draw_alternatingcurrent where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_alternatingcurrent + int_freq) then
        call doLog('type:red, table:draw_alternatingcurrent, Data acquisition error.');
        set varWarnR = '1';
    end if;

    -- 
    select max(id) into nowId from draw_ath;
    select utc into tempTime from draw_ath where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_ath + int_freq) then
        call doLog('type:red, table:draw_ath, Data acquisition error.');
        set varWarnR = '1';
    else
        --  2:
        select temp , reletive_humidity_1min into temp_douVal1 , temp_douVal2 from t_temp_wet_TDZ order by write_time desc limit 1;
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '5';
        -- 
        if int_lower is not null then
            if temp_douVal1 < int_lower then
                call doLog('type:red, object:temperature, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal1 then
                call doLog('type:red, object:temperature, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '6';
        -- 
        if int_lower is not null then
            if temp_douVal2 < int_lower then
                call doLog('type:red, object:humidity, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal2 then
                call doLog('type:red, object:humidity, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
    end if;

    -- 
    select max(id) into nowId from draw_backgroundlight;
    select utc into tempTime from draw_backgroundlight where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_backgroundlight + int_freq) then
        call doLog('type:red, table:draw_backgroundlight, Data acquisition error.');
        set varWarnR = '1';
    end if;

    -- 
    select max(id) into nowId from draw_ceilometer;
    select utc into tempTime from draw_ceilometer where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_ceilometer + int_freq) then
        call doLog('type:red, table:draw_ceilometer, Data acquisition error.');
        set varWarnR = '1';
    else
         --  2:
        select lower_cloud_bottom_avg into temp_Val5 from t_cloud_TDZ  order by write_time desc limit 1;

        if temp_Val5 is not null and temp_Val5 <> 'NCD' then
            set temp_douVal1 = temp_Val5;
            -- 
            select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '8';
            -- 
            if int_lower is not null then
                if temp_douVal1 < int_lower then
                    call doLog('type:red, object:ceilometer, Out of threshold.');
                    set varWarnR = '1';
                end if;
            end if;
            -- 
            if int_upper is not null then
                if int_upper < temp_douVal1 then
                    call doLog('type:red, object:ceilometer, Out of threshold.');
                    set varWarnR = '1';
                end if;
            end if;
        end if;

    end if;

    -- 
    select max(id) into nowId from draw_mwds;
    select utc into tempTime from draw_mwds where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_mwds + int_freq) then
        call doLog('type:red, table:draw_mwds, Data acquisition error.');
        set varWarnR = '1';
    end if;

    -- 
    select max(id) into nowId from draw_mwss;
    select utc into tempTime from draw_mwss where id = nowId;
    -- 
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_mwss + int_freq) then
        call doLog('type:red, table:draw_mwss, Data acquisition error.');
        set varWarnR = '1';
    end if;

    -- 
    select max(id) into nowId from draw_pressure;
    select utc into tempTime from draw_pressure where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_pressure + int_freq) then
        call doLog('type:red, table:draw_pressure, Data acquisition error.');
        set varWarnR = '1';
    else
         --  2:
        select barometer_read_1min into temp_douVal1 from t_temp_wet_TDZ  order by write_time desc limit 1;
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '3';
        -- 
        if int_lower is not null then
            if temp_douVal1 < int_lower then
                call doLog('type:red, object:pressure, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal1 then
                call doLog('type:red, object:pressure, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
    end if;

    -- 
    select max(id) into nowId from draw_rain;
    select utc into tempTime from draw_rain where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_rain + int_freq) then
        call doLog('type:red, table:draw_rain, Data acquisition error.');
        set varWarnR = '1';
    else
         --  2:
        select rainfall_1h into temp_douVal1 from t_rainfall_TDZ  order by write_time desc limit 1;
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '4';
        -- 
        if int_lower is not null then
            if temp_douVal1 < int_lower then
                call doLog('type:red, object:rain, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal1 then
                call doLog('type:red, object:rain, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
    end if;

    -- 
    select max(id) into nowId from draw_rlim;
    select utc into tempTime from draw_rlim where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_rlim + int_freq) then
        call doLog('type:red, table:draw_rlim, Data acquisition error.');
        set varWarnR = '1';
    end if;

    -- 1
    select max(id) into nowId from draw_ultrasonic1;
    select utc into tempTime from draw_ultrasonic1 where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_ultrasonic1 + int_freq) then
        call doLog('type:red, table:draw_ultrasonic1, Data acquisition error.');
        set varWarnR = '1';
    else
        --  2:
        select dirct_2_avrg , speed_2_avrg into temp_douVal1 , temp_douVal2 from t_wind_TDZ  order by write_time desc limit 1;
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '2';
        -- 
        if int_lower is not null then
            if temp_douVal1 < int_lower then
                call doLog('type:red, object:winddirection, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal1 then
                call doLog('type:red, object:winddirection, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '1';
        -- 
        if int_lower is not null then
            if temp_douVal2 < int_lower then
                call doLog('type:red, object:windspeed, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal2 then
                call doLog('type:red, object:windspeed, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
    end if;

    -- 2
    select max(id) into nowId from draw_ultrasonic2;
    select utc into tempTime from draw_ultrasonic2 where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_ultrasonic2 + int_freq) then
        call doLog('type:red, table:draw_ultrasonic2, Data acquisition error.');
        set varWarnR = '1';
    end if;

    -- 
    select max(id) into nowId from draw_visibility;
    select utc into tempTime from draw_visibility where id = nowId;
    -- 
    --  1:
    if TIMESTAMPDIFF(SECOND, tempTime, nowTime) > ( int_visibility + int_freq) then
        call doLog('type:red, table:draw_visibility, Data acquisition error.');
        set varWarnR = '1';
    else
         --  2:
        -- 
        select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '7';
        -- 
        select mor_1 into temp_douVal1 from t_runway_visual_TDZ where kbn = '1' order by write_time desc limit 1;
        -- 
        if int_lower is not null then
            if temp_douVal1 < int_lower then
                call doLog('type:red, object:visibility, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
        -- 
        if int_upper is not null then
            if int_upper < temp_douVal1 then
                call doLog('type:red, object:visibility, Out of threshold.');
                set varWarnR = '1';
            end if;
        end if;
    end if;

    --  2:
    -- 
    select vertical_vis into temp_douVal1 from t_cloud_TDZ  order by write_time desc limit 1;
    -- 
    select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '11';
    -- 
    if int_lower is not null then
        if temp_douVal1 < int_lower then
            call doLog('type:red, object:vertical_vision, Out of threshold.');
            set varWarnR = '1';
        end if;
    end if;
    -- 
    if int_upper is not null then
        if int_upper < temp_douVal1 then
            call doLog('type:red, object:vertical_vision, Out of threshold.');
            set varWarnR = '1';
        end if;
    end if;

    -- RVR
    select rvr_1_avg into temp_douVal1 from t_runway_visual_TDZ where kbn = '1'  order by write_time desc limit 1;
    -- RVR
    select lmt_lower, lmt_upper into int_lower, int_upper from t_threshold where lmt_cd = '9';
    -- 
    if int_lower is not null then
        if temp_douVal1 < int_lower then
            call doLog('type:red, object:RVR, Out of threshold.');
            set varWarnR = '1';
        end if;
    end if;
    -- 
    if int_upper is not null then
        if int_upper < temp_douVal1 then
            call doLog('type:red, object:RVR, Out of threshold.');
            set varWarnR = '1';
        end if;
    end if;

    -- 
    select max(id) into nowId from draw_visibility;
    select count(*) into temp_douVal1 from t_master t1, draw_visibility t2 where t1.kbn_id = 'M03' and t1.extend_2 = TRIM(t2.Precipitation) and t2.id = nowId;
    -- 
    if temp_douVal1 < 1 then
        call doLog('type:red, object:Precipitation, Out of threshold.');
        set varWarnR = '1';
    end if;
    -- ,



    -- SPECI,
    -- ,
    -- 
    select speed_10_blastwind , dirct_10_avrg into temp_douVal1 , temp_douVal2 from t_wind_TDZ order by write_time desc limit 1;
    -- 
    select speed_10_blastwind , dirct_10_avrg into temp_douVal3 , temp_douVal4 from t_wind_TDZ order by write_time desc limit 1,1;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '1';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:windspeed, Out of speci.');
        set varWarnO = '2';
    end if;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '2';
    if abs(temp_douVal2 - temp_douVal4) > temp_speci then
        call doLog('type:orange, object:winddirection, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select barometer_read_1min into temp_douVal1 from t_temp_wet_TDZ order by write_time desc limit 1;
    -- 
    select barometer_read_1min into temp_douVal3 from t_temp_wet_TDZ order by write_time desc limit 1,1;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '3';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:pressure, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select rainfall_1h into temp_douVal1 from t_rainfall_TDZ order by write_time desc limit 1;
    select rainfall_1h into temp_douVal3 from t_rainfall_TDZ order by write_time desc limit 1,1;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '4';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:pressure, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select temp, reletive_humidity_1min into temp_douVal1 ,temp_douVal2 from t_temp_wet_TDZ order by write_time desc limit 1;
    -- 
    select temp, reletive_humidity_1min into temp_douVal3, temp_douVal4  from t_temp_wet_TDZ order by write_time desc limit 1,1;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '5';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:temperature, Out of speci.');
        set varWarnO = '2';
    end if;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '6';
    if abs(temp_douVal2 - temp_douVal4) > temp_speci then
        call doLog('type:orange, object:humidity, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select mor_1 into temp_douVal1 from t_runway_visual_TDZ where kbn = '1' order by write_time desc limit 1;
    -- 
    select mor_1 into temp_douVal3 from t_runway_visual_TDZ where kbn = '1' order by write_time desc limit 1,1;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '7';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:visibility, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select lower_cloud_bottom_avg into temp_Val5 from t_cloud_TDZ order by write_time desc limit 1;
    -- 
    select lower_cloud_bottom_avg into temp_Val6 from t_cloud_TDZ order by write_time desc limit 1,1;
    -- 
    if (temp_Val5 <> 'NCD' and temp_Val6 <> 'NCD' ) then
        select speci into temp_speci from t_threshold where lmt_cd = '8';
        set temp_douVal1 = temp_Val5;
        set temp_douVal3 = temp_Val6;
        if abs(temp_douVal1 - temp_douVal3) > temp_speci then
            call doLog('type:orange, object:cloud, Out of speci.');
            set varWarnO = '2';
        end if;
    end if;

    -- RVR
    select rvr_10_avg into temp_Val5 from t_runway_visual_TDZ where kbn = '1' order by write_time desc limit 1;
    if substr(temp_Val5, 1,1) = 'M' or substr(temp_Val5, 1,1) = 'P' then
        set temp_douVal1 = substr(temp_Val5, 2);
    else 
        set temp_douVal1 = temp_Val5;
    end if;
    -- 
    select rvr_10_avg into temp_Val6 from t_runway_visual_TDZ where kbn = '1' order by write_time desc limit 1,1;
    if substr(temp_Val6, 1,1) = 'M' or substr(temp_Val6, 1,1) = 'P' then
        set temp_douVal3 = substr(temp_Val6, 2);
    else 
        set temp_douVal3 = temp_Val6;
    end if;
    -- RVR
    select speci into temp_speci from t_threshold where lmt_cd = '9';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:RVR, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select max(id) into nowId from draw_visibility;
    select locate(TRIM(t2.Precipitation), t1.speci) into varExist from t_threshold t1, draw_visibility t2  where t1.lmt_cd = '10' and t2.id = nowId;
    if varExist = '1' then
        call doLog('type:orange, object:Precipitation, Out of speci.');
        set varWarnO = '2';
    end if;

    -- 
    select vertical_vis into temp_douVal1 from t_cloud_TDZ order by write_time desc limit 1;
    -- 
    select vertical_vis into temp_douVal3 from t_cloud_TDZ order by write_time desc limit 1,1;
    -- 
    select speci into temp_speci from t_threshold where lmt_cd = '9';
    if abs(temp_douVal1 - temp_douVal3) > temp_speci then
        call doLog('type:orange, object:vertical_vision, Out of speci.');
        set varWarnO = '2';
    end if;

    -- ,

    -- 
    if varWarnO = '2' then
        call doInfo('p1', '3');
    end if;

    -- 
        
    -- 
    call doLog(CONCAT('nowTime:' ,nowTime, '+doWarning end...'));

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for doWind
-- ----------------------------
DROP PROCEDURE IF EXISTS `doWind`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `doWind`( runwaycd varchar(10), location varchar(10))
BEGIN 

    -- 
    -- 
    DECLARE write_time datetime;
    -- 
    DECLARE dirct_inst int(3);
    -- -
    DECLARE dirct_tailwind_inst int(3);
    -- -
    DECLARE dirct_upwind_inst int(3);
    -- -
    DECLARE dirct_sidewind_inst varchar(10);
    -- 
    DECLARE speed_inst double(5,1);
    -- -
    DECLARE speed_tailwind_inst double(5,1);
    -- -
    DECLARE speed_upwind_inst double(5,1);
    -- -
    DECLARE speed_sidewind_inst double(5,1);
    -- 2min
    DECLARE dirct_2_min int(3);
    -- 2min
    DECLARE dirct_2_max int(3);
    -- 2min
    DECLARE dirct_2_avrg int(3);
    -- 2min-
    DECLARE dirct_2_blastwind int(3);
    -- 2min-
    DECLARE dirct_2_tailwind int(3);
    -- 2min-
    DECLARE dirct_2_upwind int(3);
    -- 2min-
    DECLARE dirct_2_sidewind varchar(10);
    -- 10min
    DECLARE dirct_10_min int(3);
    -- 10min
    DECLARE dirct_10_max int(3);
    -- 10min
    DECLARE dirct_10_avrg int(3);
    -- 10min-
    DECLARE dirct_10_blastwind int(3);
    -- 10min-
    DECLARE dirct_10_tailwind int(3);
    -- 10min-
    DECLARE dirct_10_upwind int(3);
    -- 10min-
    DECLARE dirct_10_sidewind varchar(10);
    -- 2min
    DECLARE speed_2_min double(5,1);
    -- 2min
    DECLARE speed_2_max double(5,1);
    -- 2min
    DECLARE speed_2_avrg double(5,1);
    -- 2min-
    DECLARE speed_2_blastwind double(5,1);
    -- 2min-
    DECLARE speed_2_tailwind double(5,1);
    -- 2min-
    DECLARE speed_2_upwind double(5,1);
    -- 2min-
    DECLARE speed_2_sidewind double(5,1);
    -- 10min
    DECLARE speed_10_min double(5,1);
    -- 10min
    DECLARE speed_10_max double(5,1);
    -- 10min
    DECLARE speed_10_avrg double(5,1);
    -- 10min-
    DECLARE speed_10_blastwind double(5,1);
    -- 10min-
    DECLARE speed_10_tailwind double(5,1);
    -- 10min-
    DECLARE speed_10_upwind double(5,1);
    -- 10min-
    DECLARE speed_10_sidewind double(5,1);
    -- 1h-
    DECLARE dirct_tailwind_1h int(3);
    -- 1h-
    DECLARE speed_tailwind_1h double(5,1);
    -- 1h-
    DECLARE blastwind_time_1h datetime;
    -- 24h-
    DECLARE dirct_tailwind_24h int(3);
    -- 24h-
    DECLARE speed_tailwind_24h double(5,1);
    -- 24h-
    DECLARE blastwind_time_24h datetime;
    -- 
    DECLARE air_magnetic_declination double(5,2);
    -- 
    DECLARE dirct_start int(3);
    -- 
    DECLARE dirct_end int(3);

    --  
    DECLARE temp_sin double;
    --  
    DECLARE temp_cos double;
    -- 1
    DECLARE dirct_1h int(3);
    -- 1h
    DECLARE speed_1h double(5,1);
    -- 2min
    DECLARE speed_2_maxtime datetime;
    -- 10min
    DECLARE speed_10_maxtime datetime;

    -- 
    -- ID
    DECLARE tempId int;
    -- ID
    DECLARE nowId int;

    -- 
    DECLARE tempwinddirection double(10,3);
    -- 
    DECLARE tempwinddirectionAvg double(10,3);
    -- 
    DECLARE tempwindspeed double(10,3);
    -- 
    DECLARE reTailwind varchar(1);
    -- 
    DECLARE reDirSidewind varchar(1);
    -- 
    DECLARE reSidewind double(10,3);
    -- 
    DECLARE reWind double(10,3);
    -- 
    DECLARE reWindDirection double(10,3);
    --  
    DECLARE startTime datetime;
    --  
    DECLARE endTime datetime;

    -- 
    set write_time = UTC_TIMESTAMP();

    -- 
    call doLog(CONCAT('location:', location, '+write_time:' ,write_time, '+wind start...'));

    -- ID
    select max(id) into nowId from draw_ultrasonic1 ;
    --  
    set endTime = write_time;

    -- 
    select magnetic_declination into air_magnetic_declination from t_airport;
    --  
    -- ,
    select getDirection(winddirection+air_magnetic_declination), windspeed into tempwinddirection, tempwindspeed from draw_ultrasonic1 where id = nowId;
    set dirct_inst = tempwinddirection;
    set speed_inst = tempwindspeed;
    -- 
    set reTailwind = getTailwind(tempwinddirection, runwaycd) ;
    -- 
    set reWind = getWind(tempwinddirection, tempwindspeed, runwaycd) ;
    -- 
    set reDirSidewind = getDirSidewind(tempwinddirection, runwaycd) ;
    -- 
    set reSidewind = getSidewind(tempwinddirection, tempwindspeed, runwaycd) ;
    -- 
    set reWindDirection = getWindDirection(tempwinddirection, runwaycd) ;

    -- 
    if reTailwind= 1 then
        -- 
        -- -
        set dirct_tailwind_inst = reWindDirection;
        -- -
        set speed_tailwind_inst = reWind;
        -- -
        set dirct_sidewind_inst = CONCAT(reDirSidewind, ROUND((90-reWindDirection)/10)*10);
        -- -
        set speed_sidewind_inst = reSidewind;
    elseif reTailwind= 2 then
        -- 
        -- -
        set dirct_upwind_inst = reWindDirection;
        -- -
        set speed_upwind_inst = reWind;
        -- -
        set dirct_sidewind_inst = CONCAT(reDirSidewind, ROUND((90-reWindDirection)/10)*10);
        -- -
        set speed_sidewind_inst = reSidewind;
    else
        -- 
        -- -
        set dirct_sidewind_inst = CONCAT(reDirSidewind, 90);
        -- -
        set speed_sidewind_inst = tempwindspeed;
    end if;
    --  

    -- 2 
    --  
    set startTime = date_add(endTime, interval -2 minute);
    -- 
    select max(windspeed), min(windspeed),avg(windspeed)
        into speed_2_max, speed_2_min, speed_2_avrg
        from draw_ultrasonic1 where utc between startTime and endTime;
    select max(utc)
        into speed_2_maxtime
        from draw_ultrasonic1 where windspeed = speed_2_max between startTime and endTime;
    select sum(SIN(RADIANS(getDirection(winddirection+air_magnetic_declination))))/count(*), sum(COS(RADIANS(getDirection(winddirection+air_magnetic_declination)))) /count(*)
        into temp_sin, temp_cos
        from draw_ultrasonic1 where utc between startTime and endTime;
    set dirct_2_avrg = degrees(atan(temp_sin/temp_cos));
    -- 
    if temp_sin > 0 and temp_cos > 0 then
        set dirct_2_avrg = dirct_2_avrg;
    elseif (temp_sin < 0 and temp_cos < 0) or (temp_sin > 0 and temp_cos < 0)  then
        set dirct_2_avrg = dirct_2_avrg + 180;
    elseif (temp_sin < 0 and temp_cos > 0) then
        set dirct_2_avrg = dirct_2_avrg + 360;
    elseif (temp_sin = 0 and temp_cos > 0) then
        set dirct_2_avrg = 360;
    elseif (temp_sin = 0 and temp_cos < 0) then
        set dirct_2_avrg = 180;
    elseif (temp_sin > 0 and temp_cos = 0) then
        set dirct_2_avrg = 90;
    elseif (temp_sin < 0 and temp_cos = 0) then
        set dirct_2_avrg = 270;
    end if;

    -- 
    if dirct_2_avrg > 180 then
        -- 
        set dirct_start = dirct_2_avrg - 180;
        -- 
        set dirct_end  = dirct_2_avrg;
        -- 
        select min(getDirection(winddirection+air_magnetic_declination)) into dirct_2_min 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination) between dirct_start and dirct_end;
        -- 
        select max(case when getDirection(winddirection+air_magnetic_declination) > dirct_end then getDirection(winddirection+air_magnetic_declination) - 360 
                                 else getDirection(winddirection+air_magnetic_declination)  end ) into dirct_2_max 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination)  not between dirct_start and dirct_end;
        if dirct_2_max < 0 then
            set dirct_2_max = dirct_2_max + 360;
        end if;
    else
        -- 
        set dirct_start = dirct_2_avrg;
        -- 
        set dirct_end  = dirct_2_avrg + 180;
        -- 
        select max(getDirection(winddirection+air_magnetic_declination)) into dirct_2_max 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination) between dirct_start and dirct_end;
        -- 
        select min(case when getDirection(winddirection+air_magnetic_declination) > dirct_end then getDirection(winddirection+air_magnetic_declination) - 360 
                                 else getDirection(winddirection+air_magnetic_declination)  end ) into dirct_2_min 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination)  not between dirct_start and dirct_end;
        if dirct_2_min < 0 then
            set dirct_2_min = dirct_2_min + 360;
        end if;
    end if;

    -- ,
    set tempwinddirection = dirct_2_avrg;
    set tempwindspeed = speed_2_avrg;
    
    -- 
    set reTailwind = getTailwind(tempwinddirection, runwaycd) ;
    -- 
    set reWind = getWind(tempwinddirection, tempwindspeed, runwaycd) ;
    -- 
    set reDirSidewind = getDirSidewind(tempwinddirection, runwaycd) ;
    -- 
    set reSidewind = getSidewind(tempwinddirection, tempwindspeed, runwaycd) ;
    -- 
    set reWindDirection = getWindDirection(tempwinddirection, runwaycd) ;

    -- 
    if reTailwind= 1 then
        -- 
        -- 2min-
        set dirct_2_tailwind = reWindDirection;
        -- -2min
        set speed_2_tailwind = reWind;
        -- 2min-
        set dirct_2_sidewind = CONCAT(reDirSidewind, ROUND((90-reWindDirection)/10)*10);
        -- 2min-
        set speed_2_sidewind = reSidewind;
    elseif reTailwind= 2 then
        -- 
        -- 2min-
        set dirct_2_upwind = reWindDirection;
        -- 2min-
        set speed_2_upwind = reWind;
        -- 2min-
        set dirct_2_sidewind = CONCAT(reDirSidewind, ROUND((90-reWindDirection)/10)*10);
        -- 2min-
        set speed_2_sidewind = reSidewind;
    else
        -- 
        -- 2min-
        set dirct_2_sidewind = CONCAT(reDirSidewind, 90);
        -- 2min-
        set speed_2_sidewind = tempwindspeed;
    end if;

    --  5/
    if speed_2_max - speed_2_avrg > 5 then
        -- 2min-
        select max(id) into tempId from draw_ultrasonic1 where utc between startTime and endTime and windspeed = speed_2_max;
        select getDirection(winddirection+air_magnetic_declination) into dirct_2_blastwind from draw_ultrasonic1 where id = tempId;
        -- 2min-
        set speed_2_blastwind =speed_2_max;
    end if;
    -- 2 

    -- 10 
    --  
    set startTime = date_add(endTime, interval -10 minute);
    -- 
    select max(windspeed), min(windspeed),avg(windspeed)
        into speed_10_max, speed_10_min, speed_10_avrg
        from draw_ultrasonic1 where utc between startTime and endTime;
    select max(utc)
        into speed_10_maxtime
        from draw_ultrasonic1 where windspeed = speed_10_max between startTime and endTime;
    select sum(SIN(RADIANS(getDirection(winddirection+air_magnetic_declination)))) /count(*), sum(COS(RADIANS(getDirection(winddirection+air_magnetic_declination)))) /count(*)
        into temp_sin, temp_cos
        from draw_ultrasonic1 where utc between startTime and endTime;
    set dirct_10_avrg = degrees(atan(temp_sin/temp_cos));
    -- 
    if temp_sin > 0 and temp_cos > 0 then
        set dirct_10_avrg = dirct_10_avrg;
    elseif (temp_sin < 0 and temp_cos < 0) or (temp_sin > 0 and temp_cos < 0)  then
        set dirct_10_avrg = dirct_10_avrg + 180;
    elseif (temp_sin < 0 and temp_cos > 0) then
        set dirct_10_avrg = dirct_10_avrg + 360;
    elseif (temp_sin = 0 and temp_cos > 0) then
        set dirct_10_avrg = 360;
    elseif (temp_sin = 0 and temp_cos < 0) then
        set dirct_10_avrg = 180;
    elseif (temp_sin > 0 and temp_cos = 0) then
        set dirct_10_avrg = 90;
    elseif (temp_sin < 0 and temp_cos = 0) then
        set dirct_10_avrg = 270;
    end if;

    -- 
    if dirct_10_avrg > 180 then
        -- 
        set dirct_start = dirct_10_avrg - 180;
        -- 
        set dirct_end  = dirct_10_avrg;
        -- 
        select min(getDirection(winddirection+air_magnetic_declination)) into dirct_10_min 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination) between dirct_start and dirct_end;
        -- 
        select max(case when getDirection(winddirection+air_magnetic_declination) > dirct_end then getDirection(winddirection+air_magnetic_declination) - 360 
                                 else getDirection(winddirection+air_magnetic_declination)  end ) into dirct_10_max 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination)  not between dirct_start and dirct_end;
        if dirct_10_max < 0 then
            set dirct_10_max = dirct_10_max + 360;
        end if;
    else
        -- 
        set dirct_start = dirct_10_avrg;
        -- 
        set dirct_end  = dirct_10_avrg + 180;
        -- 
        select max(getDirection(winddirection+air_magnetic_declination)) into dirct_10_max 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination) between dirct_start and dirct_end;
        -- 
        select min(case when getDirection(winddirection+air_magnetic_declination) > dirct_end then getDirection(winddirection+air_magnetic_declination) - 360 
                                 else getDirection(winddirection+air_magnetic_declination)  end ) into dirct_10_min 
        from draw_ultrasonic1 where utc between startTime and endTime and getDirection(winddirection+air_magnetic_declination)  not between dirct_start and dirct_end;
        if dirct_10_min < 0 then
            set dirct_10_min = dirct_10_min + 360;
        end if;
    end if;

    -- ,
    set tempwinddirection = dirct_10_avrg;
    set tempwindspeed = speed_10_avrg;
    
    -- 
    set reTailwind = getTailwind(tempwinddirection, runwaycd) ;
    -- 
    set reWind = getWind(tempwinddirection, tempwindspeed, runwaycd) ;
    -- 
    set reDirSidewind = getDirSidewind(tempwinddirection, runwaycd) ;
    -- 
    set reSidewind = getSidewind(tempwinddirection, tempwindspeed, runwaycd) ;
    -- 
    set reWindDirection = getWindDirection(tempwinddirection, runwaycd) ;

    -- 
    if reTailwind= 1 then
        -- 
        -- 10min-
        set dirct_10_tailwind = reWindDirection;
        -- -10min
        set speed_10_tailwind = reWind;
        -- 10min-
        set dirct_10_sidewind = CONCAT(reDirSidewind, ROUND((90-reWindDirection)/10)*10);
        -- 10min-
        set speed_10_sidewind = reSidewind;
    elseif reTailwind= 2 then
        -- 
        -- 10min-
        set dirct_10_upwind = reWindDirection;
        -- 10min-
        set speed_10_upwind = reWind;
        -- 10min-
        set dirct_10_sidewind = CONCAT(reDirSidewind, ROUND((90-reWindDirection)/10)*10);
        -- 10min-
        set speed_10_sidewind = reSidewind;
    else
        -- 
        -- 10min-
        set dirct_10_sidewind = CONCAT(reDirSidewind, 90);
        -- 10min-
        set speed_10_sidewind = tempwindspeed;
    end if;

    --  5/
    if speed_10_max - speed_10_avrg > 5 then
        -- 10min-
        select max(id) into tempId from draw_ultrasonic1 where utc between startTime and endTime and windspeed = speed_10_max;
        select getDirection(winddirection+air_magnetic_declination) into dirct_10_blastwind from draw_ultrasonic1 where id = tempId;
        -- 10min-
        set speed_10_blastwind =speed_10_max;
    end if;
    -- 10 

    -- 1 
    --  
    set startTime = date_add(endTime, interval -1 hour);
    -- 
    select max(windspeed), avg(windspeed)
        into tempwindspeed,tempwinddirectionAvg
        from draw_ultrasonic1 where utc between startTime and endTime;

    --  5/
    if tempwindspeed - tempwinddirectionAvg > 5 then
        -- id
        select max(id) into tempId from draw_ultrasonic1 where utc between startTime and endTime and windspeed = tempwindspeed;
        -- 1h-
        -- 1h-
        select winddirection, utc into dirct_tailwind_1h, blastwind_time_1h from draw_ultrasonic1 where id = tempId;
        -- 1h-
        set speed_tailwind_1h =tempwindspeed;
    end if;
    -- 1 

    -- 24 
    --  
    set startTime = date_add(endTime, interval -24 hour);
    -- 
    select max(windspeed), avg(windspeed)
        into tempwindspeed,tempwinddirectionAvg
        from draw_ultrasonic1 where utc between startTime and endTime;

    --  5/
    if tempwindspeed - tempwinddirectionAvg > 5 then
        -- id
        select max(id) into tempId from draw_ultrasonic1 where utc between startTime and endTime and windspeed = tempwindspeed;
        -- 24h-
        -- 24h-
        select winddirection, utc into dirct_tailwind_24h, blastwind_time_24h from draw_ultrasonic1 where id = tempId;
        -- 24h-
        set speed_tailwind_24h =tempwindspeed;
    end if;
    -- 24 

    -- 1 
    -- 
    set startTime = date_add(endTime, interval -1 hour);
    -- 
    select avg(windspeed)
        into speed_1h
        from draw_ultrasonic1 where utc between startTime and endTime;
    select sum(SIN(RADIANS(getDirection(winddirection+air_magnetic_declination))))/count(*), sum(COS(RADIANS(getDirection(winddirection+air_magnetic_declination)))) /count(*)
        into temp_sin, temp_cos
        from draw_ultrasonic1 where utc between startTime and endTime;
    set dirct_1h = degrees(atan(temp_sin/temp_cos));
    -- 
    if temp_sin > 0 and temp_cos > 0 then
        set dirct_1h = dirct_1h;
    elseif (temp_sin < 0 and temp_cos < 0) or (temp_sin > 0 and temp_cos < 0)  then
        set dirct_1h = dirct_1h + 180;
    elseif (temp_sin < 0 and temp_cos > 0) then
        set dirct_1h = dirct_1h + 360;
    elseif (temp_sin = 0 and temp_cos > 0) then
        set dirct_1h = 360;
    elseif (temp_sin = 0 and temp_cos < 0) then
        set dirct_1h = 180;
    elseif (temp_sin > 0 and temp_cos = 0) then
        set dirct_1h = 90;
    elseif (temp_sin < 0 and temp_cos = 0) then
        set dirct_1h = 270;
    end if;
    -- 1 

        location,
        write_time,
        dirct_inst,
        dirct_tailwind_inst,
        dirct_upwind_inst,
        dirct_sidewind_inst,
        speed_inst,
        speed_tailwind_inst,
        speed_upwind_inst,
        speed_sidewind_inst,
        dirct_2_min,
        dirct_2_max,
        dirct_2_avrg,
        dirct_2_blastwind,
        dirct_2_tailwind,
        dirct_2_upwind,
        dirct_2_sidewind,
        dirct_10_min,
        dirct_10_max,
        dirct_10_avrg,
        dirct_10_blastwind,
        dirct_10_tailwind,
        dirct_10_upwind,
        dirct_10_sidewind,
        speed_2_min,
        speed_2_max,
        speed_2_avrg,
        speed_2_blastwind,
        speed_2_tailwind,
        speed_2_upwind,
        speed_2_sidewind,
        speed_10_min,
        speed_10_max,
        speed_10_avrg,
        speed_10_blastwind,
        speed_10_tailwind,
        speed_10_upwind,
        speed_10_sidewind,
        dirct_tailwind_1h,
        speed_tailwind_1h,
        blastwind_time_1h,
        dirct_tailwind_24h,
        speed_tailwind_24h,
        blastwind_time_24h, 
        dirct_1h,
        speed_1h, 
        speed_2_maxtime,
        speed_10_maxtime)
    VALUES(
        location,
        write_time,
        ROUND(dirct_inst/10)*10,
        ROUND(dirct_tailwind_inst/10)*10,
        ROUND(dirct_upwind_inst/10)*10,
        dirct_sidewind_inst,
        speed_inst,
        speed_tailwind_inst,
