-- ----------------------------
-- Function structure for get10data
-- ----------------------------
DROP FUNCTION IF EXISTS `get10data`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `get10data`(dataKbn varchar(1), startTime datetime, endTime datetime) RETURNS varchar(10) CHARSET latin1 COLLATE latin1_german1_ci
BEGIN 

    -- 
    DECLARE numOk int;
    -- 
    DECLARE reVal varchar(10);
    -- 
    DECLARE air_magnetic_declination double(5,2);
    --  
    DECLARE temp_sin double;
    --  
    DECLARE temp_cos double;

    -- 
    if dataKbn = '1' then
        -- 1: 
        select avg(vision) into reVal from draw_visibility where utc >= startTime and utc < endTime;
    elseif dataKbn = '2' then
        -- 2: 
        set numOk = (select count(*) from draw_ceilometer where utc >= startTime and utc < endTime and trim(first) <> 'NODET')
                            + (select count(*) from draw_ceilometer where utc >= startTime and utc < endTime and trim(second) <> 'NODET')
                            + (select count(*) from draw_ceilometer where utc >= startTime and utc < endTime and trim(third) <> 'NODET');
        if numOk > 0 then
            set reVal = round(((select sum(first) from draw_ceilometer where utc >= startTime and utc < endTime and trim(first) <> 'NODET')
                                       + (select sum(second) from draw_ceilometer where utc >= startTime and utc < endTime and trim(second) <> 'NODET')
                                       + (select sum(third) from draw_ceilometer where utc >= startTime and utc < endTime and trim(third) <> 'NODET'))/numOk);
        else
            set reVal = '';
        end if;
    elseif dataKbn = '3' then
        -- 3: 
        select sum(value) into reVal from draw_rain where utc >= startTime and utc < endTime;
    elseif dataKbn = '4' then
        -- 4: 
        select avg(temperature) into reVal from draw_ath where utc >= startTime and utc < endTime;
    elseif dataKbn = '5' then
        -- 5:
        select avg(pressure) into reVal from draw_pressure where utc >= startTime and utc < endTime;
    elseif dataKbn = '6' then
        -- 6:
        select avg(humidity) into reVal from draw_ath where utc >= startTime and utc < endTime;
    elseif dataKbn = '7' then
        -- 7:
        select avg(windspeed) into reVal from draw_ultrasonic1 where utc >= startTime and utc < endTime;
    else
        -- 8:
        -- 
        select magnetic_declination into air_magnetic_declination from t_airport;
        select sum(SIN(RADIANS(getDirection(winddirection+air_magnetic_declination))))/count(*),
                  sum(COS(RADIANS(getDirection(winddirection+air_magnetic_declination)))) /count(*)
            into temp_sin, temp_cos
            from draw_ultrasonic1 where utc >= startTime and utc < endTime;
        set reVal = degrees(atan(temp_sin/temp_cos));
        -- 
        if temp_sin > 0 and temp_cos > 0 then
            set reVal = reVal;
        elseif (temp_sin < 0 and temp_cos < 0) or (temp_sin > 0 and temp_cos < 0)  then
            set reVal = reVal + 180;
        elseif (temp_sin < 0 and temp_cos > 0) then
            set reVal = reVal + 360;
        elseif (temp_sin = 0 and temp_cos > 0) then
            set reVal = 360;
        elseif (temp_sin = 0 and temp_cos < 0) then
            set reVal = 180;
        elseif (temp_sin > 0 and temp_cos = 0) then
            set reVal = 90;
        elseif (temp_sin < 0 and temp_cos = 0) then
            set reVal = 270;
        end if;
        SET reVal = ROUND(reVal/10)*10;
    end if;

    return ROUND(reVal);

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getDirection
-- ----------------------------
DROP FUNCTION IF EXISTS `getDirection`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getDirection`( winddirection int) RETURNS int(11)
BEGIN 
    DECLARE dodirection INT ;

    SET dodirection =winddirection;

    IF winddirection > 360 THEN 
        SET dodirection =winddirection -360;
    END IF;

    IF winddirection <= 0 THEN 
        SET dodirection =winddirection +360;
    END IF;

    -- 
    RETURN dodirection;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getDirSidewind
-- ----------------------------
DROP FUNCTION IF EXISTS `getDirSidewind`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getDirSidewind`( winddirection int, runwaycd varchar(10)) RETURNS varchar(1) CHARSET utf8
BEGIN 


    DECLARE rundirection INT;
    DECLARE startKbn VARCHAR(1);
    DECLARE redirection VARCHAR(1);

    -- 
    select direction,startdirection into rundirection,startKbn from t_runway where rwy_cd = runwaycd;

    -- 
    IF startKbn = '1' THEN 
        SET rundirection =getDirection(rundirection + 180);
    END IF;

    set winddirection = getDirection(winddirection);

    IF rundirection >= 180 THEN 
        IF winddirection < rundirection and winddirection > (rundirection - 180) THEN 
            set redirection = 'R';
        ELSE
            set redirection = 'L';
        END IF;
    ELSE
        IF winddirection > rundirection and winddirection <= (rundirection + 180) THEN 
            set redirection = 'L';
        ELSE
            set redirection = 'R';
        END IF;
    END IF;

    -- 
    IF (winddirection = rundirection)  or (getDirection(rundirection+180) = winddirection) THEN
            set redirection = '';
    END IF;
    
    -- 
    RETURN redirection;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getSidewind
-- ----------------------------
DROP FUNCTION IF EXISTS `getSidewind`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getSidewind`( winddirection int, windspeed double, runwaycd varchar(10)) RETURNS double
BEGIN 

    DECLARE rundirection INT ;
    DECLARE dodirection INT ;

    -- 
    select direction into rundirection from t_runway where rwy_cd = runwaycd;

    -- 
    set dodirection = abs(winddirection-rundirection);

    -- 
    IF dodirection > 90 
    THEN 
        SET dodirection =180 -dodirection;  
    END IF;

    -- 
    RETURN abs(round(SIN(RADIANS(dodirection)) * windspeed,1));
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getTailwind
-- ----------------------------
DROP FUNCTION IF EXISTS `getTailwind`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getTailwind`( winddirection int, runwaycd varchar(10)) RETURNS varchar(1) CHARSET utf8
BEGIN 


    DECLARE rundirection INT;
    DECLARE startKbn VARCHAR(1);
    DECLARE tailwind VARCHAR(1);

    -- 
    select direction,startdirection into rundirection,startKbn from t_runway where rwy_cd = runwaycd;

    -- 
    IF startKbn = '1' THEN 
        SET rundirection =getDirection(rundirection + 180);
    END IF;

    -- 
    set tailwind = '2';

    set winddirection = getDirection(winddirection);

    -- 
    IF rundirection > 90 and rundirection <= 270 THEN 
        IF (winddirection > rundirection - 90)  and (winddirection < rundirection + 90)   THEN 
            set tailwind = '1';
        END IF;
    ELSEIF rundirection > 0 and rundirection <= 90 THEN 
        IF (winddirection > 0 and winddirection <=rundirection ) or ( winddirection <= 360 and winddirection > getDirection(rundirection - 90 ) ) or  (winddirection >rundirection  and winddirection < rundirection + 90)   THEN 
            set tailwind = '1';
        END IF;
    ELSEIF rundirection > 270 and rundirection <= 360 THEN 
        IF (winddirection > rundirection - 90 and winddirection <=rundirection )  or  (winddirection >rundirection  and winddirection <= 360)  or ( winddirection > 0 and winddirection < getDirection(rundirection + 90 )  ) THEN 
            set tailwind = '1';
        END IF;
    END IF;

    -- 
    IF (getDirection(winddirection+90) = rundirection)  or (getDirection(rundirection+90) = winddirection) THEN
            set tailwind = '0';
    END IF;

    -- 
    RETURN tailwind;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getWind
-- ----------------------------
DROP FUNCTION IF EXISTS `getWind`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getWind`( winddirection int, windspeed double, runwaycd varchar(10)) RETURNS double
BEGIN 

    DECLARE rundirection INT ;
    DECLARE dodirection INT ;

    -- 
    select direction into rundirection from t_runway where rwy_cd = runwaycd;

    -- 
    set dodirection = abs(winddirection-rundirection);

    -- 
    IF dodirection > 90 
    THEN 
        SET dodirection =180 -dodirection;  
    END IF;

    -- 
    RETURN abs(round(COS(RADIANS(dodirection)) * windspeed,1));
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getWindDirection
-- ----------------------------
DROP FUNCTION IF EXISTS `getWindDirection`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getWindDirection`( winddirection int, runwaycd varchar(10)) RETURNS int(11)
BEGIN 

    DECLARE rundirection INT ;
    DECLARE dodirection INT ;

    -- 
    select direction into rundirection from t_runway where rwy_cd = runwaycd;

    -- 
    set dodirection = abs(winddirection-rundirection);
    if dodirection > 180 then
        set dodirection = dodirection -180;
    end if;

    -- 
    IF dodirection > 90 
    THEN 
        SET dodirection =180 -dodirection;  
    END IF;

    -- 
    RETURN dodirection;
END
;;
