CREATE TRIGGER `trigger_draw_visibility_insert` AFTER INSERT ON `draw_visibility` FOR EACH ROW BEGIN 

    -- 
    DECLARE locationCd varchar(10);
    -- ID
    DECLARE preId int;
    -- ID
    DECLARE nowId int;
    -- 
    DECLARE prePrecipitation varchar(10);
    -- 
    DECLARE nowPrecipitation varchar(10);
    -- 
    DECLARE writeTime datetime;

    -- 
    set locationCd = 'p1';
    -- ID
    select max(id) into nowId from draw_visibility;
    -- 
    select Precipitation into nowPrecipitation from draw_visibility where id = nowId;

    -- 
    set preId = nowId -1;
    if preId > 0 then
        -- 
        select Precipitation into prePrecipitation from draw_visibility where id = preId;
    else
        -- ()
        set prePrecipitation = 'XX';
    end if;

    -- 
    if prePrecipitation <> nowPrecipitation then

        -- 
        select max(write_time) into writeTime from t_weather where location = locationCd and write_kbn = '0' and time_end is null;
        -- 
        update t_weather set time_end = NEW.utc ,update_time = NEW.utc where location = locationCd and write_time = writeTime;

        -- 
            location,
            write_time,
            write_kbn,
            weather_cd,
            time_start,
            insert_time,
            insert_user,
            update_time,
            update_user)
        VALUES (
            locationCd,
            NEW.utc,
            '0',
            (select prj_id from t_master where kbn_id = 'M03' and extend_2 = TRIM(NEW.Precipitation)),
            NEW.utc,
            NEW.utc,
            'admin',
            NEW.utc,
            'admin');
    end if;

END
;;
