DROP TRIGGER IF EXISTS `t_info_receive_insert`;
DELIMITER ;;
CREATE TRIGGER `t_info_receive_insert` BEFORE INSERT ON `t_info_receive` FOR EACH ROW BEGIN 

    -- TAF
    DECLARE isRepostTaf varchar(1);
    -- 
    DECLARE locationCD varchar(20);
    -- 
    DECLARE infoTime varchar(20);
    -- CD
    DECLARE infoType varchar(20);
    -- 
    -- 
    DECLARE infoContent varchar(255);
    -- 
    DECLARE infoName varchar(20);
    -- 
    DECLARE infoTimeTmp varchar(20);
    -- UTC
    DECLARE utc_spacing varchar(10);
    -- , , gbk
    DECLARE address varchar(10) character set gbk;

    -- 
    set infoContent = NEW.info;

    -- 
    set infoName = left(infoContent, 5);
    
    -- : 1: METAR 2:TAF 3:SPECI
    if infoName = 'METAR' or infoName = 'SPECI' then
        if infoName = 'METAR' then
            set infoType = '1';
        else
            set infoType = '3';
        end if;
        -- 
        set locationCD = substring(infoContent, 7, 4);
        set infoTimeTmp = substring(infoContent, 12, 7);
    else
        set infoType = '2';
        set locationCD = substring(infoContent, 5, 4);
        set infoTimeTmp = substring(infoContent, 10, 7);
        set locationCD = null;
        set infoTimeTmp = null;
    end if;
    
    -- 
    set infoTime = date_format(concat(date_format(CURDATE(), '%Y%m'), left(infoTimeTmp, 6), '00'), '%Y-%m-%d %H:%i:%s');
    -- UTC
    if right(infoTimeTmp, 1) = 'Z' then
        select time_diff into utc_spacing from t_system;
        set infoTime = date_add(infoTime, interval utc_spacing hour);
    elseif infoTimeTmp is null then
        set infoTime = null;
	end if;
    
    -- , 
    set NEW.info_time = infoTime;
    set NEW.info_type = infoType;
    -- master
    select prj_name into address from t_master where prj_id = locationCD and kbn_id = 'M14';
    -- 
    if address is null then
        set address = '';
	end if;
    -- 
    set NEW.from_address = address;

    -- 
    select is_repost_taf into isRepostTaf from t_system;
    -- ,2:TAF
    if isRepostTaf = '1' and infoType = '2' then
        -- 
            info_type,
            info_time,
            info,
            is_send,
            insert_time,
            insert_user,
            update_time,
            update_user)
        VALUES (
            NEW.info_type,
            NEW.info_time,
            NEW.info,
            '0',
            NEW.update_time,
            'admin',
            NEW.update_time,
            'admin');
    end if;

END
;;
